import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import reportWebVitals from './reportWebVitals';
import './components/styles/posts.css';
import PostItem from './components/posts';

let [posts, setPosts] = useState([
	{'id':1, 'title': 'Язык Python', 'body': 'Язык программирования'},
	{'id':2, 'title': 'Язык Python', 'body': 'Язык программирования'},
	{'id':3, 'title': 'Язык Python', 'body': 'Язык программирования'},
	{'id':4, 'title': 'Язык Python', 'body': 'Язык программирования'},
	{'id':5, 'title': 'Язык Python', 'body': 'Язык программирования'}
])

ReactDOM.render(
  <div>
	  {posts.map(post=>
		<PostItem post={post}/>
	  )}

  </div>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
